import React from 'react';

const Logo = () => {
    return (
      <div className="logo">
          <img src="./img/signe.png" alt="logo vbs" />
            <h3>VOS BESOINS SERVICES</h3>

            <ul>
            <li></li>
            <li className="welcome">
              <NavLink exact to="/profil">
                <h5>Bienvenue {userData.pseudo}</h5>
              </NavLink>
            </li>
             Logout
          </ul>

      </div>
    );
};

export default Logo;
